part of 'home_bloc_cubit.dart';abstract class HomeBlocState extends Equatable {  const HomeBlocState();}class HomeBlocInitial extends HomeBlocState {  @override  List<Object> get props => [];}class HomeDataResponse extends HomeBlocState {  final dynamic homeData;  HomeDataResponse(this.homeData);  @override  List<Object> get props => [homeData];}class DataError extends HomeBlocState {  final error;  DataError(this.error);  @override  List<Object> get props => [error];}